import classes from './Header.module.css';
import meals from './meals.jpg'

const Header = () => {
    return <>
    <div className={classes.header}>
        <p>Delicious Meals</p>
    </div>
    <div className={classes.mainimage}>
            <img src={meals} alt="Delicious meals"/>
        </div>
    </>
}

export default Header;
